    false,nt"url": null,nt"notes": "This annual narrative report for Tewaukon
    NWR and Tewaukon WMD outlines activities and accomplishments during the 2001 calendar
    year. The report begins with an introduction to the Refuge. Highlights and weather
    conditions are summarized for the year. Habitat restoration and management projects
    are also covered; activities include wetland management, water rights, water quality,
    fire management, and vegetation control. Fish and wildlife management are discussed
    next with emphasis on waterfowl, migratory birds, wildlife disturbance, and endangered
    species. Public use and recreation are summarized including fishing, hunting, wildlife
    observation, and environmental education.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
